import { Card,Button } from 'antd'
import React from 'react'
import { useSelector } from 'react-redux'


function myRecord() {
    const {me}=useSelector((state)=>state.user)
  return (
    <div>
        <h1>내가 뛴목록</h1>
        {me.posts.map((v)=>(
            <Card
            hoverable
            >
                {v.title}
                <Button style={{fontSize:10}}>내가 뛴목록</Button>
            </Card>
        ))}
    </div>
  )
}

export default myRecord
